import React from "react";
import "./Header.css";
import AccountBalanceIcon from "@mui/icons-material/AccountBalance";
import LibraryBooksIcon from "@mui/icons-material/LibraryBooks";
import SchoolIcon from "@mui/icons-material/School";
import CalendarMonthIcon from '@mui/icons-material/CalendarMonth';
import CurrencyRupeeIcon from '@mui/icons-material/CurrencyRupee';
import SupportAgentIcon from "@mui/icons-material/SupportAgent";
const Header = () => {
  return (
    <div className="header">
      <div className="headerContainer">
        <div className="headerList">
          {/* icon1 */}
          <div className="headerItem active">
            <AccountBalanceIcon  className="headerIcon"/>
            <span>Schools/Colleges</span>
          </div>
          {/* icons2 */}
          <div className="headerItem">
            <LibraryBooksIcon  className="headerIcon"/>
            <span>Exams</span>
          </div>
          {/* icon3 */}
          <div className="headerItem">
            <SchoolIcon  className="headerIcon"/>
            <span>Courses</span>
          </div>
          {/* icon4 */}
          <div className="headerItem">
            <SupportAgentIcon  className="headerIcon"/>
            <span>Guidance Support</span>
          </div>
        </div>
        <h1 className="headerTitle">Wanna find your desired school?</h1>
        <p className="headerDoc">
            Paat-Vihar helps you find you a sustainable school that best fits you !!.---Right place Right school
        </p>
        <button className="headerBtn">Sign in / Register</button>
        <div className="headerSearch">
            <div className="headerSearchItem">
                <AccountBalanceIcon  className="headerIcon"/>
                <input type="text" placeholder="Location" className="headerSearchInput"/>
            </div>
            {/* search 2 */}
            <div className="headerSearchItem">
                <CalendarMonthIcon className="headerIcon"/>
                <span className="headerSearchText">Joining Date</span>
            </div>
            {/* search2 */}
            <div className="headerSearchItem">
                <CurrencyRupeeIcon  className="headerIcon"/>
                <input type="text" placeholder="Fee" className="headerSearchInput"/>
                <span className="headerSearchText">Fees</span>
            </div>
        </div>
      </div>
    </div>
  );
};

export default Header;
